import { makeStyles } from '@material-ui/styles';
import { Provider } from 'react-redux';
import Login from './containers/Login';
import store from './redux/store';
// import './App.css';

import { useEffect } from 'react';

const useStyles = makeStyles({
    root: {
        height: '100%',
        width: '100%',
        minWidth: 800,
        overflow: 'auto',
        fontFamily: '-apple-system,system-ui,BlinkMacSystemFont,Segoe UI,Roboto,Helvetica Neue,Fira Sans,Ubuntu,Oxygen,Oxygen Sans,Cantarell,Droid Sans,Apple Color Emoji,Segoe UI Emoji,Segoe UI Symbol,Lucida Grande,Helvetica,Arial,sans-serif',
    }
});



const App = () => {
    const classes = useStyles();

    useEffect(() => {
        document.querySelector('html').style.width = '100%';
        document.querySelector('html').style.height = '100%';
        document.querySelector('html').style.margin = '0px';
        document.querySelector('body').style.width = '100%';
        document.querySelector('body').style.height = '100%';
        document.querySelector('body').style.margin = '0px';
        document.getElementById('root').style.margin = '0px';
        document.getElementById('root').style.height = '0px';
        document.getElementById('root').style.width = '0px';
    }, []);

    return (
        <Provider store={store}>
            <div className={classes.root}>
                <Login />
            </div>
        </Provider>
    );
};

export default App;
